A total of 36 individuals were examined (
Table 2
).

Scalation: The 3 nasal scales on each side always bulging, the interior ones usually separated by the rostral and the frontonasal, only in 3 out of 36 specimens the nasals meet in a suture (which is shorter than in
burchelli
); 29 to 36 transverse ventral rows (median 32); 14 to 18 longitudinal ventral rows (median 16). The anterior 6 to 11 transverse rows (sometimes called pectoral scales) are arranged in a V-shape and scale numbers are substantially reduced around the armpits, after which they are aligned horizontally onto the flanks, often only gradually decreasing in size and merging into the dorsal scales.

Midbody scales smooth, arranged in 46 to 64 rows (median 56) ( 48 to 62 in Branch 1998 ,
Conradie et al. 2012
). In nine individuals (25%) the prefrontals are in contact (mostly separated by 1 scale; 2 in one individual, or by a suture between the frontal and the frontonasal in one individual). Scales in the temporal region show a tendency to enlarge towards the ear opening (in case there is an enlarged scale at the anterodorsal edge of the ear opening, it is not curved and there is at least one additional row of scales separating it from the ear opening); tympanic shield and elongate scales (lobes) absent; upper labials 8 to 13 (usually 11), with 4 (in two individuals) to 7 (usually 5 or 6) in front of the subocular scale which borders the lip; usually 2 scales between the subocular and the freno-ocular; lower labials 5 (in one individual on one side only) to 9, usually 7 or 8; femoral pores 11 to 18 on each thigh; enlarged scales in collar 6 to 11; occipital scale present; interparietal usually longer than broad, in four individuals occipital and interparietal are separated by 1 additional scale or granule; supraoculars 2, bordered by small granules anteriorly, posteriorly and along the supraciliaries in all individuals. In 61% the anterior supraocular is also surrounded with granules along its inner border, separating it from the frontal, and in 28% both supraoculars have the inner border edged with granules. Usually 15 or more granules anterior to the supraoculars. Chin shields pairs usually 5 (exceptionally up to 7), in most cases the anterior 3 are entirely in contact along their interior edge (in three individuals only the anterior 2 chin shields). Freno-ocular 1, frenonasal 1, in one individual (the holotype of
E. laticeps
) they are fused on one side, in a second one there is one additional scale below the freno-ocular; supraciliaries 6 (in one individual) to 12, usually 9 to 10; lower eyelid covered with several small, semi-transparent scales.
